import React from "react";
import TagList from "../data/TagList";

// This will handle displaying and adding new tags
// TagList will maintain the list of tags, as well as accept the new tags being added
class Tag extends React.Component {
  state = { newTag: "" };

  submitNewTag = event => {
    event.preventDefault();

  };

  render() {
    return (
      <div>
        <div>
          <TagList />
        </div>
        <form onSubmit={this.submitNewTag}>
          <div className="ui right labeled left icon input">
            <i className="tags icon" />
            <input
              type="text"
              placeholder="Enter tags"
              value={this.state.newTag}
              onChange={e => this.setState({ newTag: e.target.value })}
            />
            <button type="submit" className="ui tag label">
              Add Tag
            </button>
          </div>
        </form>
      </div>
    );
  }
}

export default Tag;
